import { Grid ,Container} from '@mui/material'
import Cards from './molecules/Cards';
import one from './atoms/images/1.png';
import two from './atoms/images/2.png';
import three from './atoms/images/3.png';
import four from './atoms/images/4.png';
import five from './atoms/images/5.png';
import six from './atoms/images/6.png';
import seven from './atoms/images/7.png';
import eight from './atoms/images/8.png';
import nine from './atoms/images/9.png';
import BOOKS from './books';

function CurrentBooks(){
    return (
    <Container style={{paddingLeft:"7%",paddingRight:"7%"}}>
      <Grid container rowSpacing={2} spacing={4}>
        <Grid item xs={12} sm={6} md={4}>
          <Cards imag={one} name={BOOKS[0].name} author={BOOKS[0].author} duration={BOOKS[0].duration}/>
        </Grid>

        <Grid item xs={12} sm={6} md={4}>
        <Cards imag={two} name="Employee to Entrepreneur" author="Steve Glaveski" duration="15"/>
        </Grid>

        <Grid item xs={12} sm={6} md={4}>
        <Cards imag={three} name="Doesnâ€™t Hurt to Ask" author="Trey Gowdy" duration="13" noOfReads="1.9"/>
        </Grid>

        <Grid item xs={12} sm={6} md={4}>
          <Cards imag={four} name="The Fate of Food" author="Amanda Little" duration="12" noOfReads="16"/>
        </Grid>

        <Grid item xs={12} sm={6} md={4}>
        <Cards imag={five} name="Lives of the Stoics" author="Ryan Holiday, Stephen Hansel" duration="13"/>
        </Grid>

        <Grid item xs={12} sm={6} md={4}>
        <Cards imag={six} name="Loving Your Business" author="Debbie King" duration="13"/>
        </Grid>

        <Grid item xs={12} sm={6} md={4}>
        <Cards imag={seven} name="The Lonely Century" author="Noreena Hertz" duration="15"/>
        </Grid>

        <Grid item xs={12} sm={6} md={4}>
        <Cards imag={eight} name="Eat Better, Feel Better" author="Giada De Laurentiis" duration="13" noOfReads="1.9"/>
        </Grid>

        <Grid item xs={12} sm={6} md={4}>
        <Cards imag={nine} name="Dropshipping" author="James Moore" duration="12"/>
        </Grid>

      </Grid>
      </Container>
    );
}
export default CurrentBooks;
